import React from 'react';
import './post.css';

function Post() {
  return (
    <div className='post-container'>
<div className="post-account">
    <div className="post-logo">
        <img src={'logo512.png'} alt="" />
    </div>
    <p className='post-name'>acc-name</p>
</div>
<img  
className='post-img'
src={'logo512.png'} 
alt="img"
 />
<p >
    post title
</p>
    </div>
  );
}

export default Post;
